import './css/Turtle.css';
import React from 'react';
import { Link } from 'react-router-dom';

export default function Turtle() {
    return(
        <div>
            <div className='menu'>
                <p className='pageName'>거북이 수족관</p>
                <p className='logOut'>로그아웃</p>
                <Link to='./DeepSea'><p>DeepSea</p></Link>
            </div>
        </div>
    )
}
